import { AppBar,Toolbar, styled } from '@mui/material'
import React from 'react';
const StyledToolbar = styled(Toolbar)({
    display: "flex",
    justifyContent: "space-between"
})

const Navbar = () => {
  return (
    <AppBar position='stick'>
        <StyledToolbar>
            <Ty></Ty>
            Navbar
        </StyledToolbar>
    </AppBar>
  )
}

export default Navbar
